description:
Recently sold: $240,000. Fantastic Location in sought after Roseville Schools. Centrally
Located, Minutes to either Downtown, Convenient Freeway access, Close to Many Parks, Shopping,&amp; The John Rose Oval. This Solid 1953 Rambler has great bones! It Offers 3 Bedrooms on the Main, Hardwood Floors-under Carpet, Neutral Tiled Bathroom and has Replacement Windows. The HUGE Bay window in the Living room is a Great Place to Curl up with a Book in the Morning Sun. This Home has a Concrete Patio- with a Plumbed in Natural Gas Grill, a HUGE Covered Porch/Deck off of Kitchen, and In-ground Sprinkler System. There is a Ton of Outdoor Space For Extending Living and Entertaining Options. Basement has Drain Tile &amp;
Sump Pumps. The Home has been in this Family for Decades. Owner Requires &quot;as is&quot; addendum as Seller acquired the Property as Part of an Estate. One Owner is a Licensed R.E. Agent in Mn. Seller will not be making Any Repairs as a Result of the Inspection. This One will Not last!-

Recently sold: $454,500. Beautifully Renovated Turn-Key Home on a Spacious Lot; this one you have to see to believe! 
Available only due to Relocation...

